import { View, Text, Image, TouchableOpacity } from 'react-native'
import React, { useState, useEffect } from 'react'
import { Divider } from 'react-native-elements'
import { useNavigation } from '@react-navigation/native'
import { Ionicons } from '@expo/vector-icons'

const icons =[
    {
        name: 'Home',
        active: 'https://img.icons8.com/fluency-systems-filled/144/ffffff/home.png',
        inactive: 'https://img.icons8.com/fluency-systems-regular/48/ffffff/home.png'
    },
    {
        name: 'Search',
        active: 'https://img.icons8.com/ios-filled/500/ffffff/search--v1.png',
        inactive: 'https://img.icons8.com/ios/500/ffffff/search--v1.png',
    },
    {
        name: 'Mechan',
        inactive: 'data:image/png;base64,',
        // inactive: 'https://img.icons8.com/ios/500/ffffff/search--v1.png',
        active:'data:image/png;base64,'
        
    },
    {
        name: 'Premium',
        active: 'data:image/png;base64,',
        inactive: 'data:image/jpeg;base64,',
    },

]

const BottomTab = () => {
    const [active, setActive] = useState(null);
    // const [retain, setRetain] = useState(null);
    // useEffect((e) => {
    //     // setActive(retain);
        
    // }, [navigation])
    
    const navigation = useNavigation()
  return (
    <View className='absolute w-full bottom-0.5 z-50 bg-black'>
        <Divider width={1} orientation='vertical' />
        <View className='flex-row justify-evenly flex-1  items-center h-14'> 
        <Ionicons onPress={()=>{
            navigation.navigate('VideoPlayer')
            setActive(true)
            }} name={active?'md-musical-notes':'md-musical-notes-outline'} size={30} color='white' />
    {icons.map((icon, index)=>(
        <View key={index} >
            <TouchableOpacity onPress={()=>{
                if(index == 1){
                    navigation.navigate("Search")
                    setActive(icon.name)
                    // setRetain(active);
                }
                else if(index == 0){
                    setActive(icon.name)
                    // setRetain(active);
                    navigation.navigate("Home")
                }
                else if(index == 2){
                    navigation.navigate("Me")
                    setActive(icon.name)
                    // setRetain(active);
                } else if(index === 3){
                    navigation.navigate('VideoList')
                }
                setActive(icon.name)
                // setRetain(active);
                 }}>
            <Image 
            source={{uri: icon.name === active ? icon.active : icon.inactive}}
            className='w-8 h-8 object-contain rounded-full'/>
            </TouchableOpacity>
        </View>
    ))}
    </View>
    </View>
   
  )
}

export default BottomTab